  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'


const layoutProps = {

};
export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}><MDXTag name="h1" components={components} props={{"id":"sprucebot-for-node"}}>{`Sprucebot for Node `}<MDXTag name="a" components={components} parentName="h1" props={{"href":"https://travis-ci.org/sprucelabsai/sprucebot-node"}}><MDXTag name="img" components={components} parentName="a" props={{"src":"https://travis-ci.org/sprucelabsai/sprucebot-node.svg?branch=master","alt":"Build Status"}}></MDXTag></MDXTag></MDXTag>
<MDXTag name="p" components={components}><MDXTag name="a" components={components} parentName="p" props={{"href":"https://greenkeeper.io/"}}><MDXTag name="img" components={components} parentName="a" props={{"src":"https://badges.greenkeeper.io/sprucelabsai/sprucebot-node.svg","alt":"Greenkeeper badge"}}></MDXTag></MDXTag></MDXTag>
           </MDXTag>
  }
}
